import React, { useEffect } from "react";
import Invoice from "./Invoice/Invoice";
import InvoiceHeading from "./Invoice/InvoiceHeading";
import useFetch from "./useFetch";


function App() {

const {data, loading, error} = useFetch('https://rscdev.taxadda.com/api/invoice/list');

  if(loading) return <h1>Loading...</h1>

  if(error) console.log(error);




  return (
    <div className="App">
     <nav className="navbar nav-expand navbar-dark bg-primary">
        <ul className="navbar-nav fs-5 text-white">
            <h1 className="position-center">INVOICE APP</h1>
        </ul>
     </nav>
     <InvoiceHeading name={data}/>
     <Invoice data={data}/>
    </div>

  );
}

export default App;
